const coinListDataUtils = {
    marketNames: (names) => {
        const data = {};

        console.log(names);
        names.forEach(name => {
            /*if (name.market.split("-")[0] !== "KRW")
                data[name.market] = {
                    korean: name.korean_name
                };*/
            let shortSym = name.market.split("-")[1];

            for (let checkSym in data) {
                if (shortSym === checkSym) {
                    /*
                    data[shortSym] = {
                        upbitSym: name.market
                    }*/
                    break;
                }
            }
        });

        return data;
    },
};

export {
    coinListDataUtils
}
